// FeaturedArtists.js
import React from "react";
import "../styles/Artists.css";

import taylor from '../images/taylor.jpg';
import dualipa from '../images/dualipa.jpg';
import alica from '../images/Alica.jpg';
import jimin from '../images/jimin.jpg';
import maroon5 from '../images/Maroon5.jpg';
import weekend from '../images/theweekend.jpg';

const artists = [
  {
    name: "Taylor Swift",
    image:
      taylor,
  },
  {
    name: "The Weeknd",
    image:
      weekend,
  },
  {
    name: "Dua Lipa",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/e4576af8-0e84-4343-8f90-7a01acb9c8b7",
  },
  {
    name: "Jimin",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/d8eb2888-1e74-4117-82d7-833ad29e3cc1",
  },
  {
    name: "Alicia Keys",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/f23adc16-11d7-41dc-af6a-191e03a81603",
  },
  {
    name: "Maroon 5",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/f511c102-3217-4bea-bede-8be23b969bd8",
  },
  {
    name: "Imagine Dragons",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/9a8bd237-b525-43e6-a37c-daaac39db8ce",
  },
  {
    name: "Billie Eilish",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/99452c85-26f4-4ccd-b439-7d1bd3875634",
  },
];

const FeaturedArtists = () => {
  return (
    <div className="artists">
      <h1>Featured Artists</h1>
      <div className="artist-container containers">
        {artists.map((artist, index) => (
          <div className="artist" key={index}>
            <div className="artist-img-container">
              <img src={artist.image} alt={artist.name} />
            </div>
            <p>{artist.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default FeaturedArtists;
